import { MicNone } from "@material-ui/icons";
import React from "react";

const SearchResult = ({ data }) => {
  let resultList =  data.map((item) => (
        <div className="col-3">
          <div
            className="card search-result-card"
            style={{
              display: "flex",
              flexDirection: "column",
              justifyContent: "space-between",

            }}
          >
            <div
              style={{
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
                alignItems:"center"
              }}
            >
              <img
                className="profileImage rounded-circle"
                src="https://wallpaperaccess.com/full/2213424.jpg"
              ></img>
              <div style={{marginTop: "8px" }}>
                <p style={{ textTransform: "capitalize" }}>{item.name}</p>
              </div>
            </div>
            <a
              href="#"
              style={{
                textDecoration: "none",
                color: "crimson",
                marginTop: "8px",
                marginRight: "10px",
              }}
            >
              Follow
            </a>
          </div>
        </div>

  ));
  return (
    <div className="container ">
      <div className="row">
          {resultList}
      </div>
    </div>
  );
};

export default SearchResult;
